function search(word, rend) {
	
	uniqhash = [];
	uniqhashsize = 0;
	if (rend) {
		render();
		resize();
	}
	maxchanges = document.getElementById("changes").value;
	searchResultSelected = 0;
	for (var row=0; row<cipher[which].length; row++) {
		for (var col=0; col<cipher[which][row].length; col++) {
			
			visited = [];
			for (var r=0; r<cipher[which].length; r++) {
				visited[r] = [];
				for (var c=0; c<cipher[which][r].length; c++) {
					visited[r][c] = false;
				}
			}
			searchSub(word.toUpperCase(), 0, row, col, -1, 0, new Array(), new Array(), jumps(), 0);
			if (uniqhashsize == maxresults) {
				alert("Stopping at 500 results.");
				break;
			}
		}
		if (uniqhashsize == maxresults) break;
	}
//	searchResults = uniq(searchResults);
	searchResults = new Array();
	for (var key in uniqhash) searchResults[searchResults.length] = uniqhash[key];
	searchResults.sort(function(a,b) {
		return a.score() - b.score();
/*		if (a.jumps == 0 && b.jumps > 0) return -1;
		if (a.jumps > 0 && b.jumps == 0) return 1;
		if (a.jumps > 0 && b.jumps > 0) return (1+a.changes)*a.jumps - (1+b.changes)*b.jumps;
		return a.changes - b.changes;*/
	});
	if (rend) searchRender();
	if (searchResults.length == 0) return searchResults;
	if (rend) highlightresult(0, true);
	return searchResults;
}

