function searchSub(word, index, row, col, direction, countDirectionChanges, path, pathMatches, cutoff, looseCount) {
	if (uniqhashsize == maxresults) return; 
//	debug(looseCount);
//	debug(index + ", " + row + ", " + col + ", " + direction + ", " + countDirectionChanges + ", " + path);
	if (countDirectionChanges > maxchanges) return;
	
	// allow wrapping
	var rows = cipher[which].length;
	var cols = cipher[which][0].length;
	row = (row + rows) % rows;
	col = (col + cols) % cols;
	
//	if (row < 0) return;
//	if (row >= cipher[which].length) return;
//	if (col < 0) return;
//	if (col >= cipher[which][row].length) return;

	if (visited[row][col]) return;
	visited[row][col] = true;
	
	path[path.length] = [row, col];

	var ch1 = word.charAt(index);
	var ch2 = cipher[which][row].charAt(col);
	
	var symbols = strictTranslations[ch1];
	if (!isStrict()) symbols += looseTranslations[ch1];
	
	if (!symbols) return;
	var match = symbols.indexOf(ch2) > -1;
	var matchLoose = looseTranslations[ch1].indexOf(ch2) > -1;

	if (match) {
		pathMatches[pathMatches.length] = [row, col];
	} else {
		if (cutoff == 0) {
			visited[row][col] = false;
			return;
		}
		cutoff--;
	}
	
	if (pathMatches.length == word.length) {
//		alert("found " + word + " path " + path + " changes " + countDirectionChanges);
		uniqadd(new Result(word, countDirectionChanges, jumps() - cutoff, looseCount, pathMatches.slice()));
		//results[results.length] = new Result(word, countDirectionChanges, jumps() - cutoff, looseCount, pathMatches.slice());
		visited[row][col] = false;
		return;
	}
	
	//var pathLength = path.length;
	
	for (var d=0; d<directions.length; d++) {
		var newRow = row + directions[d][0];
		var newCol = col + directions[d][1];
		searchSub(word, index+(match ? 1:0), newRow, newCol, d, countDirectionChanges + (d==direction || direction==-1 ? 0 : 1), path.slice(), pathMatches.slice(), cutoff, looseCount + (matchLoose? 1:0))
		
		//path = path.splice(0, pathLength);
	}
	visited[row][col] = false;
}

