function highlightresult(which, on) {
	if (on) {
		showWord(searchResults[which].path, searchResults[which].word);
		highlightresult(searchResultSelected, false);
		searchResultSelected = which;
	}
	var path = searchResults[which].path;
	for (var i=0; i<path.length; i++) {
		if (on) darkenrc(path[i][0], path[i][1]);
		else lightenrc(path[i][0], path[i][1]);
	}
	
	var li = document.getElementById("li_" + which);
	if (li) {
		if (on) li.className = "li_on";
		else li.className = "li_off";
	}
	
}

function Result(word, changes, jumps, loose, path) {
	this.word = word;
	this.changes = changes;
	this.jumps = jumps;
	this.loose = loose;
	this.path = path;
	
	this.score = score;
	function score() {
		return (1+changes)*(1+jumps)*(1+loose);
	}
}

