function loadParams() {
	var word = rget("w");
	var strict = rget("s");
	var ciph = rget("c");
	var changes = rget("g");
	var jumps = rget("j");

	if (word) setSearch(word);
	if (strict) setStrict(parseInt(strict));
	if (ciph) {
		if (ciph.length == 1) {
			which = parseInt(ciph);
		} else {
			which = 0;
			cipher[0] = split(ciph);
		}
	}
	if (changes) setChanges(parseInt(changes));
	if (jumps) setJumps(parseInt(jumps));
}	
	
